function tencentCrc32(a: Uint32Array, b: Uint8Array) {
	let crc: number = 0
	crc = ~crc
	b.forEach(v => {
		crc = a[(crc & 0xff) ^ v] ^ (crc >>> 8)
	})
	return (~crc) >>> 0
}

function toBytes(a: Uint32Array) {
	let ans: Uint8Array = new Uint8Array(16)
	a.forEach((value, index) => {
		ans[4 * index] = value & 0xff
		ans[4 * index + 1] = value >>> 8 & 0xff
		ans[4 * index + 2] = value >>> 16 & 0xff
		ans[4 * index + 3] = value >>> 24 & 0xff
	})
	return ans
}

function readUint128(a: Uint8Array, i: number) {
	let ans = 0
	let w = new Uint32Array(4)
	for (let cnt: number = 1; cnt <= 16 && i + cnt <= a.length; cnt++) {
		ans = ans | (a[i + cnt - 1]) << (8 * ((cnt - 1) % 4)) & 0xffffffff
		if (cnt % 4 == 0) {
			w[Math.floor(cnt / 4) - 1] = ans
			ans = 0
		}
	}
	return w
}

function roll(a: number, n: number) {
	a = a & 0xffffffff
	return a << n | a >>> (32 - n)
}

